import { useEffect, useState } from "react";
import Sidebar from '../../Components/Sidebar'
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import Helpers from '../../Config/Helpers';

export default function TemplateList() {
    const navigate = useNavigate();
    const [isLoading, setIsLoading] = useState(false);
    const [templates, setTemplate] = useState(null);

    const handleUpdate = (templateId) => {
        navigate(`/admin/templates/update/${templateId}`);
    };
    return (
        <div className="flex justify-center items-center h-screen bg-[#ebe9e9]">
            <Sidebar />
            <div className="container bg-white p-8 rounded-lg shadow-lg">

            </div>
        </div>
    )
}
